import React from 'react';
import './Resume.css';

class Gallery extends React.Component {

    render() {
        return(
          <div className="page-container">
              <h1>Resume</h1>
              <div className="resume-container">
                  <h2 className="times-new-roman">Carlos Carrasquillo</h2>
              </div>
          </div>
        )
    }
}

export default Gallery
